import axios from 'axios'

export const getUserData = async () => {
    const x = await axios.get(`${process.env.REACT_APP_ENDPOINT}/API/getUser`)
    return x.data
}

const params = {name: "admin"}

export const getTrades = async (name: string) => {
    const trades = await axios.get(`${process.env.REACT_APP_ENDPOINT}/API/getUser`, {params})
    return trades.data;
}
